css:
@-moz-document
	url-prefix('https://www.tumblr.com/')
{

.logo .svg-logo {display: none}
H1.logo/*.logo-redesign*/ .logo-anchor {height: 100%}

/*#logo {*/
H1.logo/*.logo-redesign*/ {
	position: absolute;
	height: 65px;
	width: 209px;
	margin: 4px 0 0 4px;
}
#search_field {margin-left: 229px}
/*#logo > .logo_anchor {*/
H1.logo/*.logo-redesign*/ > .logo-anchor {
	display: block;
	background-size: contain;
	background-repeat: no-repeat;
	background-image: url('data:image/png;base64,');
}

}
